import React from "react";
import "../input.css"; // 确保引入了 Tailwind CSS
import bg from "../assets/preview.gif";
function Home() {
  return (
    <div
      className="flex justify-center items-center h-screen "
      style={{
        backgroundImage: `url('/preview.gif')`,
        backgroundSize: "cover",
        backgroundPosition: "center",
      }} // 确保添加背景样式
    >
      <div className=" w-2/3 h-2/3 grid grid-cols-2 border-2 ">
        <div className="border-2 flex justify-center items-center bg-black">
          Money Book
        </div>
        <div className="border-2 flex justify-center items-center">
          {" "}
          <img src="/coming_soon.jfif "></img>
        </div>
      </div>
    </div>
  );
}

export default Home;
